pragma solidity ^0.4.17;
// We have to specify what version of compiler this code will compile with

contract Voting {
  /* mapping field below is equivalent to an associative array or hash.
  The key of the mapping is candidate name stored as type bytes32 and value is
  an unsigned integer to store the vote count
  */
  
mapping (bytes32 => uint16) public votesReceived;
  
  /* Solidity doesn't let you pass in an array of strings in the constructor (yet).
  We will use an array of bytes32 instead to store the list of candidates
  */
  
bytes32[] public candidateList;
uint16[] public candidatesVotes;


  /* This is the constructor which will be called once when you
  deploy the contract to the blockchain. When we deploy the contract,
  we will pass an array of candidates who will be contesting in the election
  */
function Voting() public {
 }

 //Solidity doesn't allow you to pass anything into the contract constrcutor anymore so created a seperate function to instatiate the candidates
 
	function getCandidateNames(bytes32[] candidateNames) public {
	candidateList = candidateNames;
	}

  // This function returns the total votes a candidate has received so far

	function totalVotesFor(bytes32 candidate) view public returns (uint16) {
	require(validCandidate(candidate));
	return votesReceived[candidate];
	}

// This function returns the total votes for ALL candidates into an array 


	function totalVotesForAll() public returns (uint16[]) {
 	for(uint i = 0; i < candidateList.length; i++) {
	candidatesVotes[i]  = totalVotesFor(candidateList[i]);
	}

	return candidatesVotes;
	}

 // This function increments the vote count for the specified candidate. This
 // is equivalent to casting a vote
	
	function voteForCandidate(bytes32 candidate) public returns (bool) {
	require(validCandidate(candidate));
	votesReceived[candidate] += 1;
	return true;
	}

	function validCandidate(bytes32 candidate) view public returns (bool) {
	for(uint i = 0; i < candidateList.length; i++) {
	if (candidateList[i] == candidate) {
        return true;
      }
    }
    return false;
  }
}
